import React from 'react';
import {
    Navbar,
    NavbarBrand, UncontrolledButtonDropdown, DropdownToggle, DropdownMenu, DropdownItem
} from 'reactstrap';
class CustomNavbar extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            isOpen: false,
            value : "Home"
        };
        this.toggle = this.toggle.bind(this);
    }
    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }
    select=(event)=>{
     this.setState({
            value: event.target.innerText
        });
    };

    render(){
     return(
         <div>
             <Navbar  light expand="md" className="navbar-background">
                 <NavbarBrand href="/"><i className="fas fa-home fa-2x "/></NavbarBrand>
                 <form className=" w-50 mx-auto">
                 <div className="input-group">
                     <div className="input-group-prepend">

                         <UncontrolledButtonDropdown>
                             <DropdownToggle >
                                 {this.state.value}<i className="fa fa-caret-down ml-2" aria-hidden="true"/>
                             </DropdownToggle>
                             <DropdownMenu>
                                 <DropdownItem onClick={this.select}>Book Name</DropdownItem>
                                 <DropdownItem onClick={this.select}>ISBN</DropdownItem>
                             </DropdownMenu>
                         </UncontrolledButtonDropdown>
                     </div>
                     <input type="text" className="form-control" placeholder="Book name"
                            aria-label="Recipient's username" aria-describedby="basic-addon2"/>
                         <div className="input-group-append">

                                <button className="btn btn-secondary">SEARCH</button>

                         </div>
                 </div>
                 </form>
           {/*      <form className="form-inline w-50 mx-auto">
                     <input className=" col-10 rounded-left" type="search" placeholder="Search" aria-label="Search"/>
                     <button className="btn btn-outline-success col-2 rounded-left" type="submit">Search</button>
                 </form>*/}
             </Navbar>

         </div>
     );
    }
}
export default CustomNavbar;
